import React, { useState, useRef } from 'react';
import { Menu, X, User, ShoppingCart } from 'lucide-react';

const WrestlingWebsite = () => {
    const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

    // Refs for scrolling to sections
    const homeRef = useRef(null);
    const shopRef = useRef(null);
    const latestNewsRef = useRef(null);

    const scrollToSection = (ref) => {
        ref.current?.scrollIntoView({ behavior: 'smooth' });
        setIsMobileMenuOpen(false); // Close mobile menu after navigation
    };

    const handleMediaKitDownload = () => {
        // This would trigger the PDF download
        const link = document.createElement('a');
        link.href = 'Media-kit.pdf'; // Replace with actual PDF path
        link.download = 'Media-Kit.pdf';
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        setIsMobileMenuOpen(false);
    };

    const NavLinks = ({ isMobile = false, onItemClick }) => (
        <nav className={isMobile ? 'mobile-nav' : 'desktop-nav'}>
            <button onClick={() => onItemClick ? onItemClick(homeRef) : scrollToSection(homeRef)} className="nav-link">
                HOME
            </button>
            <button onClick={() => onItemClick ? onItemClick(shopRef) : scrollToSection(shopRef)} className="nav-link">
                SHOP
            </button>
            <button onClick={handleMediaKitDownload} className="nav-link">
                MEDIA KIT
            </button>
            <button onClick={() => onItemClick ? onItemClick(latestNewsRef) : scrollToSection(latestNewsRef)} className="nav-link">
                LATEST NEWS
            </button>
            <button onClick={() => console.log('Contact Us clicked')} className="nav-link">
                CONTACT US
            </button>
        </nav>
    );

    return (
        <>
            <style>{`
                * {
                    margin: 0;
                    padding: 0;
                    box-sizing: border-box;
                }

                body {
                    font-family: Arial, sans-serif;
                    background-color: #000;
                    color: white;
                    line-height: 1.6;
                }

                .container {
                    min-height: 100vh;
                    background-color: #000;
                }

                /* Header Styles */
                .header {
                    background-color: #000;
                    border-bottom: 1px solid #333;
                    padding: 1rem 0;
                    position: sticky;
                    top: 0;
                    z-index: 1000;
                }

                .header-content {
                    max-width: 1200px;
                    margin: 0 auto;
                    padding: 0 1rem;
                    display: flex;
                    justify-content: space-between;
                    align-items: center;
                }

                .logo {
                    font-size: 1.5rem;
                    font-weight: bold;
                    color: #fff;
                    text-decoration: none;
                }

                .desktop-nav {
                    display: none;
                    gap: 2rem;
                }

                .nav-link {
                    background: none;
                    border: none;
                    color: #fff;
                    text-decoration: none;
                    font-size: 0.9rem;
                    cursor: pointer;
                    padding: 0.5rem 0;
                    border-bottom: 2px solid transparent;
                    transition: border-color 0.3s;
                }

                .nav-link:hover {
                    border-bottom-color: #ff6b35;
                }

                .header-right {
                    display: none;
                    align-items: center;
                    gap: 1rem;
                }

                .user-icon {
                    color: #fff;
                    cursor: pointer;
                }

                .mobile-menu-btn {
                    background: none;
                    border: none;
                    color: #fff;
                    cursor: pointer;
                    padding: 0.5rem;
                }

                /* Mobile Menu */
                .mobile-menu {
                    position: fixed;
                    top: 0;
                    left: 0;
                    right: 0;
                    bottom: 0;
                    background-color: rgba(0, 0, 0, 0.95);
                    z-index: 2000;
                    padding: 2rem;
                    display: flex;
                    flex-direction: column;
                }

